import { useState } from 'react'
import { useField } from './hooks'

const App = () => {
  const [name, setName] = useState('')
  const [born, setBorn] = useState('')
  const [height, setHeight] = useState('')
  const nomen = useField('text')

  return (
    <div>
      <form>
        name: 
        <input
          type={nomen.type}
          value={nomen.value}
          onChange={nomen.onChange} 
        /> 
        <br/> 
        birthdate:
        <input
          type='date'
          value={born}
          onChange={(event) => setBorn(event.target.value)}
        />
        <br /> 
        height:
        <input
          type='number'
          value={height}
          onChange={(event) => setHeight(event.target.value)}
        />
      </form>
      <div>
        {name} {born} {height} 
      </div>
    </div>
  )
}

export default App
